データシステム製5.0インチモニター+バックカメラキット<br><br>

走行中にも後方の状況をモニタで確認が出来ます。<br><br>

小型・薄型設計モニターの為、設置場所を選ばず、保安基準に抵触することなくダッシュボードへ設置することも可能。<br><br>

２系統入力の為、バックカメラ以外に、サイドカメラや地デジの映像も入力が出来ます。<br><br>

カメラは、プリウスα専用に加工したカメラを、純正リアガーニッシュのカメラカバーと交換するだけの簡単取付。
<br><br>

■バックカメラキットは純正部品を使用しているので、見た目もフィッティングもバッチリ！<br>
プリウスα専用に加工した、純正リアガーニッシュのカメラカバーを交換するだけの簡単取付けキットです。<BR><BR>
□商品内容□<BR>
・SSM-W5.0本体 ・パーキングアダプター <br>
・直付け用ACC電源ケーブル ・モニタースタンド <br>
・保護カバー ・両面テープ <br>
・エレクトロタップ ・脱脂クリーナー<br> 
・取扱/取付説明書 ・保証書（ユーザー保証登録カード付属）<br> 
・バックカメラ本体<BR>
・バックカメラ接続ハーネス<BR>
・ホールソー<BR>
※ピン端子ケーブルは別途ご用意ください。<br>
※シガー電源ケーブル（2m）は、別売り 1905円です。<br><br>

□対応車種□<br>
トヨタ プリウスα ZVW40/ZVW41 後期用
<BR><BR>

※納期にお時間頂く場合がございます。<br>
お急ぎの方は、ご注文前にお問い合わせ下さい。 
<BR><br>







