30セルシオ前期バックカメラキット 塗装済<BR><BR>

【商品説明】<BR>
30セルシオ前期用のバックカメラキット。<BR>
塗装済みのカバーがついているので、純正風にキレイに取り付けることができます。<BR>
また、バックカメラとカメラカバーを固定するコーキング剤や、コーキングに使用するマスキングテープ等を付属しておりますので、届いてすぐに取付が可能です！<BR>
※リバース線に接続を行う事で、TV画面時にバックで連動してバックカメラの映像に切り替わります。<BR><BR>

【カバーカラー】<BR>
ブラック/ホワイト<BR>
※カバーの塗装は 弊社で簡易的に塗装したもので、純正色ではございません。<BR>
純正色をご希望の方はお気軽にお問い合わせ下さい。<BR><BR>

※画像はイメージです。<BR>
※ご注文後 納期がかかることがございます。<BR>
